using CarDealer.Application.DataTransferObjects.Dtos.Identity;
using CarDealer.Application.DataTransferObjects.Dtos.Listing.AddLisitngDto;
using CarDealer.IntergrationTests.BaseIntegrationTest;
using FluentAssertions;
using System.Net.Http.Json;
using System.Text;


namespace CarDealer.IntegrationTests.Listings
{
    public class ListingsService : BaseIntegrationTest
    {
        const string ENDPOINT = "https://localhost:7002/api/Listing/";
        private string host = "ftp://192.168.1.6/";
        private string userName = "Anonymous";
        private string password = "mic_saw123@o2.pl";
        CancellationToken cancellationToken = default;
        public ListingsService(IntegrationTestWebAppFactory unitTestWebAppFactory)
            : base(unitTestWebAppFactory)
        {
        }

        private static AddListingDto CreateListingDto()
        {
            string image = "";
            List<byte[]> images = new List<byte[]>();
            byte[] array = Encoding.UTF8.GetBytes(image);
            images.Add(array);
            var listing = new AddListingDto()
            {
                Title = "Title",
                Description = "Description",
                SellerId = 1,
                Images = images,
                IdentifiedVehicles = new AddIdentifiedVehiclesDto()
                {
                    FirstRegistrationDate = "FirstRegistrationDate",
                    CountryOfOriginId = 1,
                    PreviouslyDamagedId = 1,
                    Vin = "Vin",
                    ProductionDate = "24/21/2023"
                },
                ListedCar = new AddListedCarDto()
                {
                    CarColorId = 1,
                    CarConditionId = 1,
                    LicensePlate = "LicensePlate",
                    Mileage = 1,
                    PreviousOwners = 1,
                    ListedCarSpecification = new AddListedCarSpecificationDto()
                    {
                        TransmissionId = 1,
                        CarTypeId = 1,
                        DoorQuantityId = 1,
                        DrivetrainId = 1,
                        EngineId = 1,
                        GenerationId = 1
                    }
                }
            };
            return listing;
        }

        private async Task RegisterUser()
        {
            RegisterDto user = new RegisterDto()
            {
                Email = "test@test.com",
                Password = "P@ssword123",
                ConfirmedPassword = "P@ssword123",
                PhoneNumber = "123456789",
                Username = "UserName",
                CityId = 1,
                AccountTypeId = 1
            };
            await _httpClient.PostAsJsonAsync("https://localhost:7002/api/Identity/Register", user);
        }

        [Fact]
        public async Task AddListing_Should_ReturnSuccess()
        {
            await RegisterUser();
            var listing = CreateListingDto();
            var result = await _httpClient.PostAsJsonAsync(ENDPOINT + "AddListing", listing);
            result.Should().BeSuccessful();
        }

        [Fact]
        public async Task DeleteListing_ShouldReturnTrue()
        {
            await RegisterUser();
            var listing = CreateListingDto();
            await _httpClient.PostAsJsonAsync(ENDPOINT + "AddListing", listing);
            var result = await _httpClient.DeleteAsync(ENDPOINT + "DeleteListing?id=" + 1);
            result.Should().BeSuccessful();
        }

        [Fact]
        public async Task GetListingById_ShouldReturnSuccess()
        {
            await RegisterUser();
            var listing = CreateListingDto();
            await _httpClient.PostAsJsonAsync(ENDPOINT + "AddListing", listing);
            var result = await _httpClient.GetAsync(ENDPOINT + "GetListingById?id=" + 1);
            result.Should().BeSuccessful();
            result.Should().NotBeNull();
        }

        [Fact]
        public async Task GetListingsBySellerId_ShouldReturnSuccess()
        {
            await RegisterUser();
            var listing = CreateListingDto();
            await _httpClient.PostAsJsonAsync(ENDPOINT + "AddListing", listing);
            var result = await _httpClient.GetAsync(ENDPOINT + "GetListingsBySellerId?id=" + 1);
            result.Should().BeSuccessful();
            result.Should().NotBeNull();
        }
    }
}

